import React from 'react'

import Nav from '../components/UI/Nav'

import '../App.css'

const styles = {
    container: {
        width: '100vw',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
    }
}

const Layout = ({ children }) => (
    <section style = { styles.container }>
        <Nav />
        { children }
    </section>
)

export default Layout
